    console.log("GroupSeqNo", queue)
    if (queue == "tobesitted") {
        return (
            "ממתין לשולחן"
        )
    }
    if (queue == "sitting") {
        return (
            "ממתין לשירות"
        )
    }
    if (queue == "awaitingbill") {
        return (
            "ממתין לחשבון"
        )
    }
}
